import React from "react";
import Emoji from "./Emoji";

function Card (props) {
    return <div>
    <dl className="dictionary">
        <div className="term">
            <Emoji 
            emojiInfo = {props.emoji}
            emojiInfo = {props.name}
            />
            <dd>
            {props.meaning}
            </dd>
        </div>
    </dl>
  </div>
}

export default Card;
